    	    + 'RANDOM SETSEED '
    	    + 'ACOS ACOSD ASIN ASIND ATAN ATAND ATAN2 ATAN2D COS COSD COT COTD SIN SIND TAN TAND '
    	    // https://www.postgresql.org/docs/11/static/functions-string.html
